%[text] # **Aircraft Chart Examples**
%[text] %[text:anchor:H_9C235D8A] **Overview**
%[text] The `AircraftChart` displays a triangulated surface representing an aircraft. The chart data comprises a triangulation object, such as that returned by the [`stlread`](<matlab: doc("stlread")>) function. The chart places the surface within a transform object (using [`hgtransform`](<matlab: doc("hgtransform")>)), which makes it straightforward to rotate the aircraft by specifying the required angle. The chart is equipped with the following methods for adjusting the aircraft's attitude:
%[text] - `roll`
%[text] - `pitch`
%[text] - `yaw`
%[text] - `reset` \
%[text] 
%[text] ![AircraftChart.png](text:image:84d8)
%[text] **Documentation**
%[text] - [`stlread`](<matlab: doc("stlread")>): Create triangulation from STL file
%[text] - [`hgtransform`](<matlab: doc("hgtransform")>): Transform graphics objects
%[text] - [`trisurf`](<matlab: doc("trisurf")>): Triangular surface plot
%[text] - [`weboptions`](<matlab: doc("weboptions")>): Specify parameters for RESTful web service
%[text] - [`webread`](<matlab: doc("webread")>): Read content from RESTful web service \
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Create a figure for the chart.
f = exampleFigure( "Name", "AircraftChart Example" ); %[output:82af0c96]
%%
%[text] ## Create the chart.
%[text] Create the chart, using the default triangulation. 
%[text] **Reference**: Airplane by Yorchmur, [`https://www.printables.com/model/34767-airplane`](<matlab: web("https://www.printables.com/model/34767-airplane")>), licensed under the Creative Commons Attribution 4.0 International License.
AC = AircraftChart( "Parent", f ); %[output:82af0c96]
%%
%[text] ## Adjust the aircraft's attitude.
AC.pitch( 5 ) %[output:0c9fdba5]
AC.roll( 30 ) %[output:0c9fdba5]
%%
%[text] ## Reset the aircraft.
AC.reset() %[output:4509ddb8]
